@ecahub - what is the value of nativeBuildSystem you're using? I think with none the TensorFlow runtime isn't actually built from source and instead you're using the one from the dependencies in gradle file. If that is something like:
dependencies {
    compile 'org.tensorflow:tensorflow-android:+'
}

then, as of today, this would resolve to version 1.4.0, which does not contain the dilations commit.
I believe your options are to either:
(a) Generate the graph with TensorFlow 1.4.0, or
(b) Build the TensorFlow runtime from sources for your Android app by setting nativeBuildSystem to bazel or cmake, or
(c) Try the "nightly" build of the Android builds as outlined in https://www.tensorflow.org/mobile/linking_libs#android
Hope that helps
